import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route, Link} from 'react-router-dom'
import ShowMenu from './ShowMenu';
import ShowMenuItem from './ShowMenuItem';
import RestaurantsList from './RestaurantsList';
import Cart from './Cart';
import Admin from './Admin';
import Admin2 from './Admin2'
import Checkout from './Checkout'
import axios from 'axios';

export const MenuContext = React.createContext();

export function roundedToFixed(input, digits) {
	var rounder = Math.pow(10, digits);
	var result = (Math.round(input * rounder) / rounder).toFixed(digits);
	return result;
}

export function OrderList(props) {
	const [orders, setOrders] = useState([]);
	const [orderItems, setOrderItems] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:3000/api/orders')
            .then(res => {
                console.log(res.data);
                setOrders(res.data);
            });
	}, [setOrders]);
	function getOrderItems(id) {
		console.log("oid: " + id)
		axios.get('http://localhost:3000/api/order_items',
		{ params: { oid: id } })
            .then(res => {
                console.log(res.data);
                setOrderItems(res.data);
            });
	}

	function changeOrderOpen(e) {
		console.log(e.target.value);
		if (e.target.value == "closed") {
			console.log("!! " + e.target.value);
		}
	}
    return (
		<>
			<div className="row">
				<div className="col-sm-12">
					<h1>Open Orders</h1>
				</div>
			</div>
			<div className="row">
				<div className="col-sm-6">
					<h3 className="text-bg-dark text-center p-1">Order Items</h3>
					<ol className="blackborder mb-2">
					{
						orderItems.length < 1 ? (
						<>
							<div>None.</div>
							<div>Select an order first.</div>
						</>) : 
						(
							orderItems.map((oi, key2) => {
								return (
									<li className="cartitem p-3" key={key2}>
										<h5>{oi.name}</h5>
										<div>
											<b className="text-success">
												${oi.price} x {oi.quantity} = ${oi.price * oi.quantity}
											</b>
										</div>
										<div>
											{oi.size}
										</div>
										<div>
											{oi.ingredients}
										</div>

									</li>
								)
							})
						)
					}
					</ol>
				</div>
				<div className="col-sm-6">
					<h3 className="text-bg-dark text-center p-1">Orders</h3>
					{
						orders.map((o, key) => {
							return (
								<div className="row">
									<div className="col-sm-8">
										<button 
											key={key}
											className="btn btn-primary form-control m-1" 
											onClick={(e) => getOrderItems(o.id)}>
											<div key={key} className="row">
												<div className="col-lg-12">
													{
														new Intl.DateTimeFormat('en-US', {
															dateStyle: 'short',
															timeStyle: 'short',
															timeZone: "America/Los_Angeles"
														}).format(new Date(o.date))
													}
												</div>
												<div className="col-lg-12">
													<b>{o.restaurant}</b>
												</div>
												<small>
													<div className="col-lg-12">
														{o.address}
													</div>
													<div className="col-lg-12">
														{o.businessType}
													</div>
													<div className="col-lg-12">
														{o.knockType}
													</div>
													<div className="col-lg-12">
														{o.text}
													</div>
												</small>
											</div>
										</button>
									</div>
									<div className="col-sm-4">
										<select 
												onChange={(e) => changeOrderOpen(e)}
												className="form-control text-bg-dark" 
												name={key} 
												id={key}>
											<option value="open">Open</option>
											<option value="closed">Closed</option>
										</select>
									</div>
								</div>
							)
						})
					}
